import React from "react";
import PropTypes from "prop-types";

function Food({ name, picture, rating }) {
  return (
    <div>
      <h2>I like {name}</h2>
      <h4>{rating}/5.0</h4>
      <img src={picture} alt={name} />
    </div>
  );
}
Food.propTypes = {
  //proptype이 맞게 쓰이고 있는지 검사하는거라 생각하셈
  name: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number.isRequired,
}; //isrequired는 이 요소가 반드시 필요하다는 뜻

function App() {
  return (
    <div className="App">
      {foodILike.map((
        dish //dish 는 foodILike에 들어있는 item을 가리킨다
      ) => (
        <Food
          key={dish.id}
          name={dish.name}
          picture={dish.image}
          rating={dish.rating}
        />
      ))}
    </div>
  );
}

export default App;
